import React, { useState, useEffect } from 'react';
import DataLoader from './DataLoader';
import KaggleContent from './KaggleContent';

function App() {
  const [content, setContent] = useState('');

  useEffect(() => {
    // Assume the file is named explanation.md in the kaggle-content directory
    fetch('/kaggle-content/explanation.md')
      .then(response => response.text())
      .then(text => setContent(text));
  }, []);

  return (
    <div className="App">
      <DataLoader />
      <KaggleContent content={content} />
    </div>
  );
}

export default App;
